import React from 'react';
import Hometext from './Hometext';
import Homeimg from './Homeimg';

const Home = () => {
  return (
    <>
    <div className='container'>
    <div className='row'>
    
  <Hometext />
  <Homeimg />
    </div>
    </div>
    </>
  )
}

export default Home;
